import Main from "../../components/Template/main";
import { useParams } from 'react-router-dom';

const Register = () => {
    const {key} = useParams();
    return(
        <div>
            <div className='pt-[90px]'>
                {key}
            </div>
            <Main />
        </div>
    )
}
export default Register;
